import '../css/App.css';
import cloud from '../image/cloud.png';
import logo from '../image/logo.png';
import wind from '../image/wind.png'

function App() {
  return (
    <div className="App">
  
   <div className="S">
                <img src={cloud} className="a1" alt="Clound" />
            </div>
            
            <div className="M">
                <img src={cloud} className="a2" alt="Clound" />
            </div>

      <div className="jfest"> <p className="jtopic">เทศกาล</p>
      
        <div className="img"><img src={logo} alt="cloud" width='438pt' />

        </div>
        <div className="S">
                <img src={wind} className="w1" alt="wind1" />
            </div>
        </div>       

    </div>
  );
}

export default App;
